import{_ as e,c as i,a1 as s,o as t}from"./chunks/framework.DhHrIClI.js";const m=JSON.parse('{"title":"工商查询","description":"","frontmatter":{},"headers":[],"relativePath":"admin-guide/ic.md","filePath":"admin-guide/ic.md"}'),r={name:"admin-guide/ic.md"};function l(n,a,c,d,o,u){return t(),i("div",null,a[0]||(a[0]=[s('<h1 id="工商查询" tabindex="-1">工商查询 <a class="header-anchor" href="#工商查询" aria-label="Permalink to &quot;工商查询&quot;">​</a></h1><h2 id="功能概述" tabindex="-1">功能概述 <a class="header-anchor" href="#功能概述" aria-label="Permalink to &quot;功能概述&quot;">​</a></h2><p>集成“天眼查”工商数据库，通过工商查询自动录入企业名称、税号等信息，减少录入操作，保证数据准确性。</p><h2 id="操作入口" tabindex="-1">操作入口 <a class="header-anchor" href="#操作入口" aria-label="Permalink to &quot;操作入口&quot;">​</a></h2><p>进入【管理后台】，点击【应用管理】，进入应用管理页面，在【扩展插件】分栏中找到【工商查询】，进入工商查询列表页面，查看并设置工商查询规则。</p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-131.png" alt=""></p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-132.png" alt=""></p><h2 id="新建下载模板" tabindex="-1">新建下载模板 <a class="header-anchor" href="#新建下载模板" aria-label="Permalink to &quot;新建下载模板&quot;">​</a></h2><p>点击右上角【新建】按钮，进入工商查询设置页面</p><ul><li>应用名称：选择需要设置工商查询的应用名称，系统预设【客户】【供应商】两个应用支持工商查询录入。</li><li>可用字段：选择用于工商查询的文本类型字段，例如【客户】应用中的“客户名称”字段，【供应商】应用中的“供应商名称”字段。</li><li>字段映射配置：配置天眼查系统中可供查询的字段与所选应用字段的映射关系，以便在选择录入表单时，选择工商数据时自动填入映射的字段信息。</li><li>限制手动输入：勾选后，将限制“可用字段”不允许手动录入，而是通过输入关键词回撤或点击输入框右侧工商查询图标后，在查询结果的下拉列表中选择录入</li><li>限制重复录入：录入时判断并提示“可用字段”在系统中已有的重复数据，并限制表单提交</li></ul><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-133.png" alt=""></p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-134.png" alt=""></p><p><img src="//swstatic.saleswork.cn/docs/usermanual/admin-guide-135.png" alt=""></p>',13)]))}const h=e(r,[["render",l]]);export{m as __pageData,h as default};
